import '../App.css';
import { Download } from '../api/download';
function App() {
  return (
    <div className="h-screen w-screen bg-[#0f0f0f]">
      <div className=" h-1/3 flex justify-center items-center">
        <h1 className="text-8xl font-bold text-transparent bg-clip-text bg-gradient-to-r from-violet-600 to-violet-900 ">YOUZAY</h1>
      </div>

      <form className="w-full flex items-center justify-center">   
      <div className="relative w-1/3">
          <input type="search" id="search" className="block w-full p-4 pl-2 text-sm border-solid border-[#2f2f2f] border-2 bg-[#121212] placeholder-gray-400 text-white  rounded-lg outline-none" placeholder="Url" required></input>
          <button onClick={Download} type="submit" className="text-white absolute right-2.5 bottom-2.5 bg-violet-600 hover:bg-violet-900 transition-all focus:outline-none  font-medium rounded-lg text-sm px-4 py-2 dark:bg-blue-600 dark:hover:bg-blue-700">Download</button>
      </div>
      </form>

    </div>
  );
}




export default App;
